import react from "react";
import { Container, Box, Grid } from "@mui/material";
import GenericInputField from "./TextField";

export default function UserEntry() {
  return (
    <>
      <Grid
        container
        direction="column"
        spacing={2}
        justifyContent="center"
        alignItems="center"
        height="100vh"
        sx={{
          width: "500px",
          backgroundColor: "red",
          boxShadow: "5px grey",
        }}
      >
        <Grid item>
          <GenericInputField
            label="FirstName"
            helperText="FirstName"
            errorStatus={true}
          />
        </Grid>
        <Grid item>
          <GenericInputField
            label="LastName"
            helperText="LastName"
            errorStatus={false}
          />
        </Grid>
        <Grid item>
          <GenericInputField
            label="Email"
            helperText="Email"
            errorStatus={false}
          />
        </Grid>
      </Grid>
    </>
  );
}
